import React, { useState, useEffect } from 'react';
import axios from 'axios';

function TaskLogComponent() {
  const [tasks, setTasks] = useState([]);

  useEffect(() => {
    fetchAllTasks();
  }, []);

  const getToken = () => {
    const token = localStorage.getItem('token');
    if (!token) {
      alert('토큰이 없습니다. 다시 로그인해주세요.');
      window.location.href = '/login'; // 토큰이 없으면 로그인 페이지로 리디렉션
      return null;
    }
    return token;
  };

  const fetchAllTasks = async () => {
    const token = getToken();
    if (!token) return;

    try {
      const response = await axios.get('http://172.30.1.28:8080/task/all', {
        headers: { Authorization: `Bearer ${token}` },
      });
      setTasks(response.data); // 모든 작업 데이터를 상태로 설정
    } catch (error) {
      console.error('작업 로그 가져오기 오류:', error);
    }
  };

  const formatDate = (date) => {
    const parsedDate = new Date(date);
    return isNaN(parsedDate) ? 'N/A' : parsedDate.toLocaleString();
  };

  return (
    <div style={{ width: 'calc(99% - 500px)', padding: '10px 20px', marginTop: '20px', borderTop: '1px solid #ccc', height: '25vh', backgroundColor: '#f9f9f9', overflowY: 'auto' }}>
      <h3>작업 로그</h3>
      <div style={{ height: '80%', overflowY: 'scroll', border: '1px solid #ccc' }}>
        <table style={{ width: '100%', borderCollapse: 'collapse' }}>
          <thead style={{ position: 'sticky', top: 0, backgroundColor: '#f9f9f9', zIndex: 1 }}>
            <tr>
              <th style={{ border: '1px solid #ccc', padding: '10px' }}>작업 이름</th>
              <th style={{ border: '1px solid #ccc', padding: '10px' }}>로봇 IP</th>
              <th style={{ border: '1px solid #ccc', padding: '10px' }}>작업 유형</th>
              <th style={{ border: '1px solid #ccc', padding: '10px' }}>상태</th>
              <th style={{ border: '1px solid #ccc', padding: '10px' }}>시작 시간</th>
              <th style={{ border: '1px solid #ccc', padding: '10px' }}>종료 시간</th>
            </tr>
          </thead>
          <tbody>
            {tasks.length > 0 ? (
              tasks.map((task, index) => (
                <tr key={index}>
                  <td style={{ border: '1px solid #ccc', padding: '10px' }}>{task.name}</td>
                  <td style={{ border: '1px solid #ccc', padding: '10px' }}>{task.robotIp}</td>
                  <td style={{ border: '1px solid #ccc', padding: '10px' }}>{task.taskType}</td>
                  <td style={{ border: '1px solid #ccc', padding: '10px' }}>{task.status}</td>
                  <td style={{ border: '1px solid #ccc', padding: '10px' }}>{formatDate(task.startTime)}</td>
                  <td style={{ border: '1px solid #ccc', padding: '10px' }}>{formatDate(task.endTime)}</td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="6" style={{ textAlign: 'center', padding: '10px' }}>작업 로그가 없습니다.</td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default TaskLogComponent;
